package ManishLokesh.Neptune.v1.GetOrderFromIRCTC.RequestBody;public class CustomerDetails {    private Long customerId;    private String customerName;    private String email;    private String mobile;    private String alternateMobile;    public Long getCustomerId() {        return customerId;    }    public void setCustomerId(Long customerId) {        this.customerId = customerId;    }    public String getCustomerName() {        return customerName;    }    public void setCustomerName(String customerName) {        this.customerName = customerName;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public String getMobile() {        return mobile;    }    public void setMobile(String mobile) {        this.mobile = mobile;    }    public String getAlternateMobile() {        return alternateMobile;    }    public void setAlternateMobile(String alternateMobile) {        this.alternateMobile = alternateMobile;    }}